import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import SearchIcon from "./../../static/icon/search.png";
import AccountCircle from "./../../static/icon/user.png";
import CartIcon from "./../../static/icon/shopping.png";
import './NavBar.css'

function NavBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" style={{ backgroundColor: "#0000CD" }}>
        <Toolbar>
          <Typography variant="h3" component="div" sx={{ flexGrow: 1 }} className='logo-label'>
            TEST
          </Typography>
          <div className='main-nav'>
          <span><p className='nav-sub-wrap icon-style'>
              Track Order
            </p></span>
              <span>
                <img src={SearchIcon} alt="search-img"  className='icon-style' />
              </span>
            <span className='icon-style'>
              <img src={CartIcon} alt="cart-img" />
            </span>
            <span className='icon-style'>
              <img src={AccountCircle} alt="user-img" />
            </span>
          </div>
        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default NavBar;
